What is the output?
class Counter {
    private int count = 0;
    public synchronized void increment() { count++; }
    public int getCount() { return count; }
},Thread-safe increment,Not thread-safe,Compilation error,Deadlock occurs

What happens with this code?
Lock lock = new ReentrantLock();
lock.lock();
try {
    // critical section
} finally {
    lock.unlock();
},Lock acquired and released properly,Compilation error,Deadlock,Lock not released

What is the result?
ConcurrentHashMap<String, Integer> map = new ConcurrentHashMap<>();
map.put("A", 1);
map.put("B", 2);,Thread-safe map operations,Not thread-safe,Compilation error,Throws exception

What is the output?
AtomicInteger count = new AtomicInteger(0);
count.addAndGet(5);
System.out.println(count.get());,5,0,Compilation error,1

What happens with synchronized method?
public synchronized void method() {
    // code
},Locks on this object,Locks on class,No locking,Compilation error

What is the result?
ReadWriteLock rwLock = new ReentrantReadWriteLock();
rwLock.readLock().lock();
rwLock.readLock().lock();,Both read locks acquired,Deadlock,Compilation error,IllegalStateException

What is the output?
CopyOnWriteArrayList<String> list = new CopyOnWriteArrayList<>();
list.add("A");
list.add("B");
System.out.println(list.size());,2,0,Compilation error,ConcurrentModificationException

What happens with ReentrantLock.tryLock()?
Lock lock = new ReentrantLock();
if (lock.tryLock()) {
    try { /* code */ }
    finally { lock.unlock(); }
},Returns true if lock acquired,Blocks forever,Compilation error,Always returns false

What is the result?
synchronized (this) {
    // critical section
},Thread-safe block,Compilation error,Not thread-safe,Locks on class

What is the output?
BlockingQueue<Integer> queue = new LinkedBlockingQueue<>();
queue.put(5);
System.out.println(queue.take());,5,Compilation error,Blocks forever,null

What happens with race condition?
class Counter {
    private int count = 0;
    public void increment() { count++; }
},Not thread-safe (race condition possible),Thread-safe,Compilation error,Deadlock guaranteed

What is the result?
ConcurrentSkipListMap<Integer, String> map = new ConcurrentSkipListMap<>();
map.put(2, "B");
map.put(1, "A");
System.out.println(map.firstKey());,1,2,Compilation error,A

What is the output?
AtomicBoolean flag = new AtomicBoolean(false);
flag.compareAndSet(false, true);
System.out.println(flag.get());,true,false,Compilation error,null

What happens with synchronized static method?
public static synchronized void method() {
    // code
},Locks on class object,Locks on instance,No locking,Compilation error

What is the result?
Lock lock = new ReentrantLock();
lock.lock();
lock.lock();
lock.unlock();,Still locked (reentrant),Deadlock,Compilation error,Fully unlocked

What is the output?
ConcurrentLinkedQueue<String> queue = new ConcurrentLinkedQueue<>();
queue.offer("A");
System.out.println(queue.poll());,A,null,Compilation error,ConcurrentModificationException

What happens with volatile variable?
volatile int count = 0;
count++;,Not atomic (race condition possible),Thread-safe,Compilation error,Atomic operation

What is the result?
Condition condition = lock.newCondition();
condition.await();,Waits for signal,Continues immediately,Compilation error,IllegalMonitorStateException

What happens with wait() and notify()?
synchronized (obj) {
    obj.wait();
},Thread waits for notify,Compilation error,IllegalMonitorStateException (if not synchronized),Continues immediately

What is the result?
ReentrantReadWriteLock lock = new ReentrantReadWriteLock();
lock.writeLock().lock();
lock.readLock().lock();,Deadlock possible,Both locks acquired,Compilation error,Write lock upgraded

What is the output?
AtomicReference<String> ref = new AtomicReference<>("A");
ref.set("B");
System.out.println(ref.get());,B,A,Compilation error,null

What happens with double-checked locking?
private volatile Instance instance;
if (instance == null) {
    synchronized (this) {
        if (instance == null)
            instance = new Instance();
    }
},Thread-safe singleton,Not thread-safe,Compilation error,volatile not needed

What is the result?
BlockingQueue<Integer> queue = new ArrayBlockingQueue<>(10);
queue.offer(5, 1, TimeUnit.SECONDS);,true (element added),false,Compilation error,Blocks forever

What is the output?
CountDownLatch latch = new CountDownLatch(1);
latch.countDown();
latch.await(1, TimeUnit.SECONDS);,Returns true immediately,Waits full second,Compilation error,Returns false

What is the result?
ConcurrentHashMap<String, Integer> map = new ConcurrentHashMap<>();
