map.putIfAbsent("A", 2);
System.out.println(map.get("A"));,1,2,Compilation error,null

What is the output?
Semaphore sem = new Semaphore(2);
sem.acquire();
sem.acquire();
System.out.println(sem.availablePermits());,0,2,1,Compilation error

What happens with StampedLock optimistic read?
StampedLock lock = new StampedLock();
long stamp = lock.tryOptimisticRead();,Read lock without blocking,Exclusive lock,Compilation error,Same as read lock

What is the result?
synchronized (lock1) {
    synchronized (lock2) {
        // code
    }
},Nested synchronization,Deadlock always,Compilation error,Only outer lock works

What is the output?
AtomicIntegerArray array = new AtomicIntegerArray(3);
array.set(0, 10);
System.out.println(array.get(0));,10,0,Compilation error,ArrayIndexOutOfBoundsException

What happens with ConcurrentModificationException?
List<String> list = new ArrayList<>();
list.add("A");
for (String s : list) {
    list.add("B");
},ConcurrentModificationException,Compilation error,Infinite loop,B added successfully

What is the result?
ReadWriteLock rwLock = new ReentrantReadWriteLock();
rwLock.writeLock().lock();
rwLock.writeLock().lock();,Both write locks acquired (reentrant),Deadlock,Compilation error,IllegalStateException

What is the output?
Phaser phaser = new Phaser(1);
phaser.arrive();
System.out.println(phaser.getPhase());,1,0,Compilation error,IllegalStateException

What happens with lock ordering to prevent deadlock?
// Thread 1: lock A then B
// Thread 2: lock B then A,Potential deadlock,No deadlock,Compilation error,Safe

What is the result?
ConcurrentHashMap<String, Integer> map = new ConcurrentHashMap<>();
map.compute("A", (k, v) -> (v == null) ? 1 : v + 1);
map.compute("A", (k, v) -> (v == null) ? 1 : v + 1);
System.out.println(map.get("A"));,2,1,Compilation error,null

What is the output?
